import React from 'react';
import './Services.css';

function Services() {
  const services = [
    { title: 'Миндальный скраб с успокаивающей маской', price: '5360₽' },
    { title: 'Массаж тела на нефритовой кровати', price: '3216₽' },
    { title: 'Ламинирование / подтяжка ресниц / бровей', price: '4288₽' },
  ];

  return (
    <div className="services">
      <section className="services-hero">
        <h1>Наши услуги</h1>
        <p>
          Насладитесь индивидуальными услугами: омолаживанием кожи,
          контурированием тела и уходом за волосами, учитывая ваши потребности
          для лучших результатов.
        </p>
      </section>

      <section className="services-grid">
        {services.map((service, index) => (
          <div className="service-card" key={index}>
            <h2>{service.title}</h2>
            <span className="service-price">{service.price}</span>
          </div>
        ))}
      </section>
    </div>
  );
}

export default Services;
